ption";s:1419:"Coffee Bagel with Cream Cheese ☕️⁣
雙重咖啡貝果⁣
⁣
唔知係咪太耐冇焗bagel 呢，尋晚既過程非常刺激，好彩都有驚冇險啫🤣🤣 感覺係咁多次入面最好食既❤️⁣
⁣
1. 貪得意係cream cheese 都加左咖啡粉，點知試味個陣，苦到呢😩 咁就由低糖變番正常糖🙈⁣
⁣
2. 有幾個落多左餡，落水前已經有爆既感覺😂 好彩最後全體安全上水⁣
⁣
3. 入爐之後佢好快開始脹，脹到一個點佢睇落隨時會爆開咁😂搞到我唔敢離開個爐⁣
⁣
4. 最後就係出到呢好似燶左啲，敲落去有聲既😂但係放左一晚之後，非常煙韌～係我想要既口感呀🤤⁣
⁣
P.S. 原來隻碟係best fit for bagel🤣⁣
P.P.S. 我好有責任心咁食番爆左果個😌⁣
⁣
Had a late night baking last night for this coffee bagel with coffee cream cheese ❤️ the process wasn’t smooth, it looked like it was gonna explode in any minute and it looked a bit overcooked when it came out. ⁣
⁣
But after a night of waiting, it turns out to be the best bagel that I made so far😂 Got to chewy texture that I want and the coffee just taste so good 🤤❤️⁣
⁣
